import React, { useState, useEffect } from 'react'
import styled from 'styled-components'

const FeedMain = props => {
  const Container = styled.div`
    display: flex;
    flex-direction: column;
    flex: 1 1 0%;
    background-color: #393945;
    /* position: relative;
    top: -160px; */
  `;


  const ListItem = styled.div`
    display: flex;
    background-color: #393945;
    height: 160px;
    padding: 1rem 3rem;
    /* position: absolute; */
    line-clamp: 2;
    margin-bottom: 2px;

  `;
  const ListContent = styled.div`
    display: flex;
    flex-direction: column;
    box-sizing:border-box;
    max-width: 400px;
`;
  const MetaData = styled.div`
    margin-bottom: 6px;
  `;

  const Title = styled.p`
    /* border: 1px solid white; */
    color: white;
    font-size: 14px;
    font-weight: 500;
    /* overflow: hidden; */
    line-clamp: 2;
    white-space: wrap;
    overflow: hidden;
  `;

  const Description = styled.p`
    /* border: 1px solid white; */
    /* overflow: hidden; */
    color: white;
    font-size: 14px;
    margin-top: .5rem;
    line-clamp: 2;
    white-space: wrap;
    overflow: hidden;

  `;

  return (
    <Container>

      {props.businessNews.map((ele, i) =>
        <ListItem style={{ top: `${162 * (i + 1)}px` }}>
          <ListContent>
            {/* <MetaData>AAPL</MetaData> */}
            <Title>
              {ele.title}
            </Title>
            <Description>
              {ele.description}
            </Description>

          </ListContent>
        </ListItem>
      )}
      {console.log(props)}
    </Container>
  );
}

export default FeedMain;
